function [damping_matrix_C,stiffness_matrix_K] = damping_matrix_repository(obj)
switch obj.problem.number_blades
    case 3
        switch obj.problem.damper_connection
            case "H2B"
                switch obj.problem.damper_activation

                    case "ALL"

                        damping_matrix_C=@(t,rotor_OMEGA) ...
                            [3*obj.problem.rotor_characteristics.nominal_damping_Cd, 0, 0, 0, 0;
                            0, 3/2*obj.problem.rotor_characteristics.nominal_damping_Cd, 3*obj.problem.rotor_characteristics.blade_inertia_Ib*rotor_OMEGA,  0, 0;
                            0, -3*obj.problem.rotor_characteristics.blade_inertia_Ib*rotor_OMEGA, 3/2*obj.problem.rotor_characteristics.nominal_damping_Cd, 0, 0;
                            0, 0, 0, obj.problem.rotor_characteristics.hub_damping_Cx, 0;
                            0, 0, 0, 0, obj.problem.rotor_characteristics.hub_damping_Cy];
                        stiffness_matrix_K=@(t,rotor_OMEGA) ...
                            [3*obj.problem.rotor_characteristics.blade_static_Sb*obj.problem.rotor_characteristics.lag_hinge_offset_e*rotor_OMEGA^2+3*obj.problem.rotor_characteristics.nominal_stiffness_Kd, 0, 0, 0, 0;
                            0, 3/2*obj.problem.rotor_characteristics.nominal_stiffness_Kd - 3/2*obj.problem.rotor_characteristics.blade_inertia_Ib*rotor_OMEGA^2 + 3/2*obj.problem.rotor_characteristics.blade_static_Sb*obj.problem.rotor_characteristics.lag_hinge_offset_e*rotor_OMEGA^2, 3/2*obj.problem.rotor_characteristics.nominal_damping_Cd*rotor_OMEGA, 0, 0;
                            0, -3/2*obj.problem.rotor_characteristics.nominal_damping_Cd*rotor_OMEGA, 3/2*obj.problem.rotor_characteristics.nominal_stiffness_Kd - 3/2*obj.problem.rotor_characteristics.blade_inertia_Ib*rotor_OMEGA^2 + 3/2*obj.problem.rotor_characteristics.blade_static_Sb*obj.problem.rotor_characteristics.lag_hinge_offset_e*rotor_OMEGA^2,0, 0;
                            0, 0, 0, obj.problem.rotor_characteristics.hub_stiffness_Kx,  0;
                            0, 0, 0, 0, obj.problem.rotor_characteristics.hub_stiffness_Ky];

                    case "ODI"

                        damping_matrix_C =@(t,rotor_OMEGA) ...
                            [2*obj.problem.rotor_characteristics.nominal_damping_Cd,                  -obj.problem.rotor_characteristics.nominal_damping_Cd*cos(rotor_OMEGA*t),                                       -obj.problem.rotor_characteristics.nominal_damping_Cd*sin(rotor_OMEGA*t),                                 0,              0;
                            -obj.problem.rotor_characteristics.nominal_damping_Cd*cos(rotor_OMEGA*t), -obj.problem.rotor_characteristics.nominal_damping_Cd/2*(cos(2*rotor_OMEGA*t)-2), 3*obj.problem.rotor_characteristics.blade_inertia_Ib*rotor_OMEGA - (obj.problem.rotor_characteristics.nominal_damping_Cd*sin(2*rotor_OMEGA*t))/2,               0,              0;
                            -obj.problem.rotor_characteristics.nominal_damping_Cd*sin(rotor_OMEGA*t), - 3*obj.problem.rotor_characteristics.blade_inertia_Ib*rotor_OMEGA - (obj.problem.rotor_characteristics.nominal_damping_Cd*sin(2*rotor_OMEGA*t))/2,                            (obj.problem.rotor_characteristics.nominal_damping_Cd*(cos(2*rotor_OMEGA*t) + 2))/2,               0,              0;
                            0, 0,                                                                         0,                                   obj.problem.rotor_characteristics.hub_damping_Cx,              0;
                            0, 0,                                                                         0,                                                0, obj.problem.rotor_characteristics.hub_damping_Cy];


                        stiffness_matrix_K =@(t,rotor_OMEGA) ...
                            [3*obj.problem.rotor_characteristics.blade_static_Sb*obj.problem.rotor_characteristics.lag_hinge_offset_e*rotor_OMEGA^2 + 3*obj.problem.rotor_characteristics.nominal_stiffness_Kd,                                                                                                                     obj.problem.rotor_characteristics.nominal_damping_Cd*rotor_OMEGA*sin(rotor_OMEGA*t),                                                                                                                    -obj.problem.rotor_characteristics.nominal_damping_Cd*rotor_OMEGA*cos(rotor_OMEGA*t),                       0,                0;
                            0, 3/2*obj.problem.rotor_characteristics.nominal_stiffness_Kd - 3/2*obj.problem.rotor_characteristics.blade_inertia_Ib*rotor_OMEGA^2 + 3/2*obj.problem.rotor_characteristics.blade_static_Sb*obj.problem.rotor_characteristics.lag_hinge_offset_e*rotor_OMEGA^2 + (obj.problem.rotor_characteristics.nominal_damping_Cd*rotor_OMEGA*sin(2*rotor_OMEGA*t))/2,                                                                                                        -(obj.problem.rotor_characteristics.nominal_damping_Cd*rotor_OMEGA*(cos(2*rotor_OMEGA*t) - 2))/2,                                                                                        0,                0;
                            0,                                                                                                        -(obj.problem.rotor_characteristics.nominal_damping_Cd*rotor_OMEGA*(cos(2*rotor_OMEGA*t) + 2))/2, 3/2*obj.problem.rotor_characteristics.nominal_stiffness_Kd - 3/2*obj.problem.rotor_characteristics.blade_inertia_Ib*rotor_OMEGA^2 + 3/2*obj.problem.rotor_characteristics.blade_static_Sb*obj.problem.rotor_characteristics.lag_hinge_offset_e*rotor_OMEGA^2 - (obj.problem.rotor_characteristics.nominal_damping_Cd*rotor_OMEGA*sin(2*rotor_OMEGA*t))/2,                                                                                        0,                0;
                            0,                                                                                                                                                                  0,                                                                                                                                                                  0,                                                                         obj.problem.rotor_characteristics.hub_stiffness_Kx,                0;
                            0,                                                                                                                                                                  0,                                                                                                                                                                  0,                                                                                        0, obj.problem.rotor_characteristics.hub_stiffness_Ky];
                end
        end
    case 4
        switch obj.problem.damper_connection
            case "H2B"
                switch obj.problem.damper_activation
                    case "ALL"

                        damping_matrix_C=@(t,rotor_OMEGA) ...
                            [4*obj.problem.rotor_characteristics.nominal_damping_Cd,                               0,                              0,                 0,              0,              0;
                            0,               2*obj.problem.rotor_characteristics.nominal_damping_Cd, 4*obj.problem.rotor_characteristics.blade_inertia_Ib*rotor_OMEGA,                 0,              0,              0;
                            0, -4*obj.problem.rotor_characteristics.blade_inertia_Ib*rotor_OMEGA,              2*obj.problem.rotor_characteristics.nominal_damping_Cd,                 0,              0,              0;
                            0,                               0,                              0, 4*obj.problem.rotor_characteristics.nominal_damping_Cd,              0,              0;
                            0,                               0,                              0,                 0, obj.problem.rotor_characteristics.hub_damping_Cx,              0;
                            0,                               0,                              0,                 0,              0, obj.problem.rotor_characteristics.hub_damping_Cy];


                        stiffness_matrix_K=@(t,rotor_OMEGA) ...
                            [4*obj.problem.rotor_characteristics.blade_static_Sb*obj.problem.rotor_characteristics.lag_hinge_offset_e*rotor_OMEGA^2 + 4*obj.problem.rotor_characteristics.nominal_stiffness_Kd,                                                                                                           0,                                                                                                           0,                                                                        0,                0,                0;
                            0, 2*obj.problem.rotor_characteristics.nominal_stiffness_Kd - 2*obj.problem.rotor_characteristics.blade_inertia_Ib*rotor_OMEGA^2 + 2*obj.problem.rotor_characteristics.blade_static_Sb*obj.problem.rotor_characteristics.lag_hinge_offset_e*rotor_OMEGA^2,                                                                               2*obj.problem.rotor_characteristics.nominal_damping_Cd*rotor_OMEGA,                                                                        0,                0,                0;
                            0,                                                                              -2*obj.problem.rotor_characteristics.nominal_damping_Cd*rotor_OMEGA, 2*obj.problem.rotor_characteristics.nominal_stiffness_Kd - 2*obj.problem.rotor_characteristics.blade_inertia_Ib*rotor_OMEGA^2 + 2*obj.problem.rotor_characteristics.blade_static_Sb*obj.problem.rotor_characteristics.lag_hinge_offset_e*rotor_OMEGA^2,                                                                        0,                0,                0;
                            0,                                                                                                           0,                                                                                                           0, 4*obj.problem.rotor_characteristics.blade_static_Sb*obj.problem.rotor_characteristics.lag_hinge_offset_e*rotor_OMEGA^2 + 4*obj.problem.rotor_characteristics.nominal_stiffness_Kd,                0,                0;
                            0,                                                                                                           0,                                                                                                           0,                                                                        0, obj.problem.rotor_characteristics.hub_stiffness_Kx,                0;
                            0,                                                                                                           0,                                                                                                           0,                                                                        0,                0, obj.problem.rotor_characteristics.hub_stiffness_Ky];

                    case "ODI" %seems to work
                        damping_matrix_C =@(t,rotor_OMEGA) ...
                            [                  3*obj.problem.rotor_characteristics.nominal_damping_Cd,                                         -obj.problem.rotor_characteristics.nominal_damping_Cd*cos(rotor_OMEGA*t),                                       -obj.problem.rotor_characteristics.nominal_damping_Cd*sin(rotor_OMEGA*t),                    obj.problem.rotor_characteristics.nominal_damping_Cd,              0,              0;
                            -obj.problem.rotor_characteristics.nominal_damping_Cd*cos(rotor_OMEGA*t),                                  obj.problem.rotor_characteristics.nominal_damping_Cd*(sin(rotor_OMEGA*t)^2 + 1), 4*obj.problem.rotor_characteristics.blade_inertia_Ib*rotor_OMEGA - (obj.problem.rotor_characteristics.nominal_damping_Cd*sin(2*rotor_OMEGA*t))/2, obj.problem.rotor_characteristics.nominal_damping_Cd*cos(rotor_OMEGA*t),              0,              0;
                            -obj.problem.rotor_characteristics.nominal_damping_Cd*sin(rotor_OMEGA*t), - 4*obj.problem.rotor_characteristics.blade_inertia_Ib*rotor_OMEGA - (obj.problem.rotor_characteristics.nominal_damping_Cd*sin(2*rotor_OMEGA*t))/2,                            (obj.problem.rotor_characteristics.nominal_damping_Cd*(cos(2*rotor_OMEGA*t) + 3))/2, obj.problem.rotor_characteristics.nominal_damping_Cd*sin(rotor_OMEGA*t),              0,              0;
                            obj.problem.rotor_characteristics.nominal_damping_Cd,                                          obj.problem.rotor_characteristics.nominal_damping_Cd*cos(rotor_OMEGA*t),                                        obj.problem.rotor_characteristics.nominal_damping_Cd*sin(rotor_OMEGA*t),                  3*obj.problem.rotor_characteristics.nominal_damping_Cd,              0,              0;
                            0,                                                                           0,                                                                         0,                                  0, obj.problem.rotor_characteristics.hub_damping_Cx,              0;
                            0,                                                                           0,                                                                         0,                                  0,              0, obj.problem.rotor_characteristics.hub_damping_Cy];


                        stiffness_matrix_K =@(t,rotor_OMEGA) ...
                            [4*obj.problem.rotor_characteristics.blade_static_Sb*obj.problem.rotor_characteristics.lag_hinge_offset_e*rotor_OMEGA^2 + 4*obj.problem.rotor_characteristics.nominal_stiffness_Kd,                                                                                                                     obj.problem.rotor_characteristics.nominal_damping_Cd*rotor_OMEGA*sin(rotor_OMEGA*t),                                                                                                                    -obj.problem.rotor_characteristics.nominal_damping_Cd*rotor_OMEGA*cos(rotor_OMEGA*t),                                                                        0,                0,                0;
                            0, 2*obj.problem.rotor_characteristics.nominal_stiffness_Kd - 2*obj.problem.rotor_characteristics.blade_inertia_Ib*rotor_OMEGA^2 + 2*obj.problem.rotor_characteristics.blade_static_Sb*obj.problem.rotor_characteristics.lag_hinge_offset_e*rotor_OMEGA^2 + (obj.problem.rotor_characteristics.nominal_damping_Cd*rotor_OMEGA*sin(2*rotor_OMEGA*t))/2,                                                                                                        -(obj.problem.rotor_characteristics.nominal_damping_Cd*rotor_OMEGA*(cos(2*rotor_OMEGA*t) - 3))/2,                                                                        0,                0,                0;
                            0,                                                                                                        -(obj.problem.rotor_characteristics.nominal_damping_Cd*rotor_OMEGA*(cos(2*rotor_OMEGA*t) + 3))/2, 2*obj.problem.rotor_characteristics.nominal_stiffness_Kd - 2*obj.problem.rotor_characteristics.blade_inertia_Ib*rotor_OMEGA^2 + 2*obj.problem.rotor_characteristics.blade_static_Sb*obj.problem.rotor_characteristics.lag_hinge_offset_e*rotor_OMEGA^2 - (obj.problem.rotor_characteristics.nominal_damping_Cd*rotor_OMEGA*sin(2*rotor_OMEGA*t))/2,                                                                        0,                0,                0;
                            0,                                                                                                                    -obj.problem.rotor_characteristics.nominal_damping_Cd*rotor_OMEGA*sin(rotor_OMEGA*t),                                                                                                                     obj.problem.rotor_characteristics.nominal_damping_Cd*rotor_OMEGA*cos(rotor_OMEGA*t), 4*obj.problem.rotor_characteristics.blade_static_Sb*obj.problem.rotor_characteristics.lag_hinge_offset_e*rotor_OMEGA^2 + 4*obj.problem.rotor_characteristics.nominal_stiffness_Kd,                0,                0;
                            0,                                                                                                                                                                  0,                                                                                                                                                                  0,                                                                        0, obj.problem.rotor_characteristics.hub_stiffness_Kx,                0;
                            0,                                                                                                                                                                  0,                                                                                                                                                                  0,                                                                        0,                0, obj.problem.rotor_characteristics.hub_stiffness_Ky];

                    case "2DI ADJ"
                        damping_matrix_C = @(t, rotor_OMEGA) ...
                            [  2*obj.problem.rotor_characteristics.nominal_damping_Cd, ...
                            -sqrt(2)*obj.problem.rotor_characteristics.nominal_damping_Cd*cos(pi/4 + rotor_OMEGA*t), ...
                            -sqrt(2)*obj.problem.rotor_characteristics.nominal_damping_Cd*sin(pi/4 + rotor_OMEGA*t), ...
                            0, 0, 0;

                            -sqrt(2)*obj.problem.rotor_characteristics.nominal_damping_Cd*cos(pi/4 + rotor_OMEGA*t), ...
                            obj.problem.rotor_characteristics.nominal_damping_Cd, ...
                            4*obj.problem.rotor_characteristics.blade_inertia_Ib*rotor_OMEGA, ...
                            sqrt(2)*obj.problem.rotor_characteristics.nominal_damping_Cd*sin(pi/4 + rotor_OMEGA*t), ...
                            0, 0;

                            -sqrt(2)*obj.problem.rotor_characteristics.nominal_damping_Cd*sin(pi/4 + rotor_OMEGA*t), ...
                            -4*obj.problem.rotor_characteristics.blade_inertia_Ib*rotor_OMEGA, ...
                            obj.problem.rotor_characteristics.nominal_damping_Cd, ...
                            -sqrt(2)*obj.problem.rotor_characteristics.nominal_damping_Cd*cos(pi/4 + rotor_OMEGA*t), ...
                            0, 0;

                            0, ...
                            sqrt(2)*obj.problem.rotor_characteristics.nominal_damping_Cd*sin(pi/4 + rotor_OMEGA*t), ...
                            -sqrt(2)*obj.problem.rotor_characteristics.nominal_damping_Cd*cos(pi/4 + rotor_OMEGA*t), ...
                            2*obj.problem.rotor_characteristics.nominal_damping_Cd, ...
                            0, 0;

                            0, 0, 0, 0, ...
                            obj.problem.rotor_characteristics.hub_damping_Cx, 0;

                            0, 0, 0, 0, ...
                            0, obj.problem.rotor_characteristics.hub_damping_Cy ];

                        stiffness_matrix_K = @(t, rotor_OMEGA) ...
                            [  4*obj.problem.rotor_characteristics.blade_static_Sb*obj.problem.rotor_characteristics.lag_hinge_offset_e*rotor_OMEGA^2 + ...
                            4*obj.problem.rotor_characteristics.nominal_stiffness_Kd, ...
                            sqrt(2)*obj.problem.rotor_characteristics.nominal_damping_Cd*rotor_OMEGA*sin(pi/4 + rotor_OMEGA*t), ...
                            -sqrt(2)*obj.problem.rotor_characteristics.nominal_damping_Cd*rotor_OMEGA*cos(pi/4 + rotor_OMEGA*t), ...
                            0, 0, 0;

                            0, ...
                            2*obj.problem.rotor_characteristics.nominal_stiffness_Kd - ...
                            2*obj.problem.rotor_characteristics.blade_inertia_Ib*rotor_OMEGA^2 + ...
                            2*obj.problem.rotor_characteristics.blade_static_Sb*obj.problem.rotor_characteristics.lag_hinge_offset_e*rotor_OMEGA^2, ...
                            obj.problem.rotor_characteristics.nominal_damping_Cd*rotor_OMEGA, ...
                            0, 0, 0;

                            0, ...
                            -obj.problem.rotor_characteristics.nominal_damping_Cd*rotor_OMEGA, ...
                            2*obj.problem.rotor_characteristics.nominal_stiffness_Kd - ...
                            2*obj.problem.rotor_characteristics.blade_inertia_Ib*rotor_OMEGA^2 + ...
                            2*obj.problem.rotor_characteristics.blade_static_Sb*obj.problem.rotor_characteristics.lag_hinge_offset_e*rotor_OMEGA^2, ...
                            0, 0, 0;

                            0, ...
                            sqrt(2)*obj.problem.rotor_characteristics.nominal_damping_Cd*rotor_OMEGA*cos(pi/4 + rotor_OMEGA*t), ...
                            sqrt(2)*obj.problem.rotor_characteristics.nominal_damping_Cd*rotor_OMEGA*sin(pi/4 + rotor_OMEGA*t), ...
                            4*obj.problem.rotor_characteristics.blade_static_Sb*obj.problem.rotor_characteristics.lag_hinge_offset_e*rotor_OMEGA^2 + ...
                            4*obj.problem.rotor_characteristics.nominal_stiffness_Kd, ...
                            0, 0;

                            0, 0, 0, 0, ...
                            obj.problem.rotor_characteristics.hub_stiffness_Kx, 0;

                            0, 0, 0, 0, ...
                            0, obj.problem.rotor_characteristics.hub_stiffness_Ky ];

                    case "2DI OPP"
                        damping_matrix_C = @(t, rotor_OMEGA) ...
                            [  2*obj.problem.rotor_characteristics.nominal_damping_Cd, 0, 0, ...
                            2*obj.problem.rotor_characteristics.nominal_damping_Cd, 0, 0;

                            0, ...
                            2*obj.problem.rotor_characteristics.nominal_damping_Cd*sin(rotor_OMEGA*t)^2, ...
                            4*obj.problem.rotor_characteristics.blade_inertia_Ib*rotor_OMEGA - ...
                            obj.problem.rotor_characteristics.nominal_damping_Cd*sin(2*rotor_OMEGA*t), ...
                            0, 0, 0;

                            0, ...
                            -4*obj.problem.rotor_characteristics.blade_inertia_Ib*rotor_OMEGA - ...
                            obj.problem.rotor_characteristics.nominal_damping_Cd*sin(2*rotor_OMEGA*t), ...
                            2*obj.problem.rotor_characteristics.nominal_damping_Cd*cos(rotor_OMEGA*t)^2, ...
                            0, 0, 0;

                            2*obj.problem.rotor_characteristics.nominal_damping_Cd, 0, 0, ...
                            2*obj.problem.rotor_characteristics.nominal_damping_Cd, 0, 0;

                            0, 0, 0, 0, ...
                            obj.problem.rotor_characteristics.hub_damping_Cx, 0;

                            0, 0, 0, 0, ...
                            0, obj.problem.rotor_characteristics.hub_damping_Cy ];

                        stiffness_matrix_K = @(t, rotor_OMEGA) ...
                            [  4*obj.problem.rotor_characteristics.blade_static_Sb* ...
                            obj.problem.rotor_characteristics.lag_hinge_offset_e*rotor_OMEGA^2 + ...
                            4*obj.problem.rotor_characteristics.nominal_stiffness_Kd, ...
                            0, 0, 0, 0, 0;

                            0, ...
                            2*obj.problem.rotor_characteristics.nominal_stiffness_Kd - ...
                            2*obj.problem.rotor_characteristics.blade_inertia_Ib*rotor_OMEGA^2 + ...
                            2*obj.problem.rotor_characteristics.blade_static_Sb* ...
                            obj.problem.rotor_characteristics.lag_hinge_offset_e*rotor_OMEGA^2 + ...
                            obj.problem.rotor_characteristics.nominal_damping_Cd*rotor_OMEGA*sin(2*rotor_OMEGA*t), ...
                            2*obj.problem.rotor_characteristics.nominal_damping_Cd*rotor_OMEGA*sin(rotor_OMEGA*t)^2, ...
                            0, 0, 0;

                            0, ...
                            -2*obj.problem.rotor_characteristics.nominal_damping_Cd*rotor_OMEGA*cos(rotor_OMEGA*t)^2, ...
                            2*obj.problem.rotor_characteristics.nominal_stiffness_Kd - ...
                            2*obj.problem.rotor_characteristics.blade_inertia_Ib*rotor_OMEGA^2 + ...
                            2*obj.problem.rotor_characteristics.blade_static_Sb* ...
                            obj.problem.rotor_characteristics.lag_hinge_offset_e*rotor_OMEGA^2 - ...
                            obj.problem.rotor_characteristics.nominal_damping_Cd*rotor_OMEGA*sin(2*rotor_OMEGA*t), ...
                            0, 0, 0;

                            0, 0, 0, ...
                            4*obj.problem.rotor_characteristics.blade_static_Sb* ...
                            obj.problem.rotor_characteristics.lag_hinge_offset_e*rotor_OMEGA^2 + ...
                            4*obj.problem.rotor_characteristics.nominal_stiffness_Kd, ...
                            0, 0;

                            0, 0, 0, 0, ...
                            obj.problem.rotor_characteristics.hub_stiffness_Kx, 0;

                            0, 0, 0, 0, ...
                            0, obj.problem.rotor_characteristics.hub_stiffness_Ky ];

                    case "3DI"

                        damping_matrix_C = @(t, rotor_OMEGA) ...
                            [ obj.problem.rotor_characteristics.nominal_damping_Cd, ...
                            obj.problem.rotor_characteristics.nominal_damping_Cd*sin(rotor_OMEGA*t), ...
                            -obj.problem.rotor_characteristics.nominal_damping_Cd*cos(rotor_OMEGA*t), ...
                            obj.problem.rotor_characteristics.nominal_damping_Cd, 0, 0;

                            obj.problem.rotor_characteristics.nominal_damping_Cd*sin(rotor_OMEGA*t), ...
                            obj.problem.rotor_characteristics.nominal_damping_Cd*sin(rotor_OMEGA*t)^2, ...
                            4*obj.problem.rotor_characteristics.blade_inertia_Ib*rotor_OMEGA - ...
                            (obj.problem.rotor_characteristics.nominal_damping_Cd*sin(2*rotor_OMEGA*t))/2, ...
                            obj.problem.rotor_characteristics.nominal_damping_Cd*sin(rotor_OMEGA*t), 0, 0;

                            -obj.problem.rotor_characteristics.nominal_damping_Cd*cos(rotor_OMEGA*t), ...
                            -4*obj.problem.rotor_characteristics.blade_inertia_Ib*rotor_OMEGA - ...
                            (obj.problem.rotor_characteristics.nominal_damping_Cd*sin(2*rotor_OMEGA*t))/2, ...
                            obj.problem.rotor_characteristics.nominal_damping_Cd*cos(rotor_OMEGA*t)^2, ...
                            -obj.problem.rotor_characteristics.nominal_damping_Cd*cos(rotor_OMEGA*t), 0, 0;

                            obj.problem.rotor_characteristics.nominal_damping_Cd, ...
                            obj.problem.rotor_characteristics.nominal_damping_Cd*sin(rotor_OMEGA*t), ...
                            -obj.problem.rotor_characteristics.nominal_damping_Cd*cos(rotor_OMEGA*t), ...
                            obj.problem.rotor_characteristics.nominal_damping_Cd, 0, 0;

                            0, 0, 0, 0, obj.problem.rotor_characteristics.hub_damping_Cx, 0;
                            0, 0, 0, 0, 0, obj.problem.rotor_characteristics.hub_damping_Cy ];

                        stiffness_matrix_K = @(t, rotor_OMEGA) ...
                            [ 4*obj.problem.rotor_characteristics.blade_static_Sb* ...
                            obj.problem.rotor_characteristics.lag_hinge_offset_e*rotor_OMEGA^2 + ...
                            4*obj.problem.rotor_characteristics.nominal_stiffness_Kd, ...
                            obj.problem.rotor_characteristics.nominal_damping_Cd*rotor_OMEGA*cos(rotor_OMEGA*t), ...
                            obj.problem.rotor_characteristics.nominal_damping_Cd*rotor_OMEGA*sin(rotor_OMEGA*t), ...
                            0, 0, 0;

                            0, ...
                            2*obj.problem.rotor_characteristics.nominal_stiffness_Kd - ...
                            2*obj.problem.rotor_characteristics.blade_inertia_Ib*rotor_OMEGA^2 + ...
                            2*obj.problem.rotor_characteristics.blade_static_Sb* ...
                            obj.problem.rotor_characteristics.lag_hinge_offset_e*rotor_OMEGA^2 + ...
                            (obj.problem.rotor_characteristics.nominal_damping_Cd*rotor_OMEGA*sin(2*rotor_OMEGA*t))/2, ...
                            obj.problem.rotor_characteristics.nominal_damping_Cd*rotor_OMEGA*sin(rotor_OMEGA*t)^2, ...
                            0, 0, 0;

                            0, ...
                            -obj.problem.rotor_characteristics.nominal_damping_Cd*rotor_OMEGA*cos(rotor_OMEGA*t)^2, ...
                            2*obj.problem.rotor_characteristics.nominal_stiffness_Kd - ...
