                            0, 0, 0, 0, 0, obj.problem.rotor_characteristics.hub_damping_Cy ];

                        % precompute time-independent stiffness coefficients
                        K_zetad  = obj.problem.rotor_characteristics.hub_to_A_a^2    * obj.problem.rotor_characteristics.nominal_stiffness_Kd * ...
                            sin(obj.problem.rotor_characteristics.zeta_E - obj.problem.rotor_characteristics.phi + obj.problem.rotor_characteristics.gamma_E) + ...
                            obj.problem.rotor_characteristics.hub_to_B_b^2    * obj.problem.rotor_characteristics.nominal_stiffness_Kd * ...
                            sin(obj.problem.rotor_characteristics.zeta_E + obj.problem.rotor_characteristics.phi + obj.problem.rotor_characteristics.gamma_E) - ...
                            obj.problem.rotor_characteristics.hub_to_A_a      * obj.problem.rotor_characteristics.nominal_stiffness_Kd * ...
                            (obj.problem.rotor_characteristics.length_eq_lE - obj.problem.rotor_characteristics.length_undef_l0) / ...
                            obj.problem.rotor_characteristics.length_eq_lE * ...
                            cos(obj.problem.rotor_characteristics.zeta_E - obj.problem.rotor_characteristics.phi + obj.problem.rotor_characteristics.gamma_E) .* ...
                            (obj.problem.rotor_characteristics.length_eq_lE - obj.problem.rotor_characteristics.hub_to_A_a * ...
