                            -rotor_OMEGA*(C_11*cos(rotor_OMEGA*t) - C_zetad*cos(rotor_OMEGA*t) - C_zetaed*sin(rotor_OMEGA*t) + 2*C_zetaed*sin(rotor_OMEGA*t)), ...
